import React from "react";
import { Typography, Stack, Paper } from "@mui/material";

const QueNumber = ({ renderOverviewPanel }) => {
  return (
    <Paper
      elevation={3}
      style={{
        padding: "20px",
        marginRight: "20px",
        width: "25%",
        backgroundColor: "#f0f0f0",
      }}
    >
      {renderOverviewPanel()}
      <hr />
      <Stack direction="row" justifyContent="space-around">
        <div style={{ display: "flex", alignItems: "center" }}>
          <div
            style={{
              width: "20px",
              height: "20px",
              backgroundColor: "#00000073",
              borderRadius: "50%",
              marginRight: "6px",
            }}
          />
          <Typography style={{ fontSize: "16px" }}>Not Visited</Typography>
        </div>
        <div style={{ display: "flex", alignItems: "center" }}>
          <div
            style={{
              width: "20px",
              height: "20px",
              backgroundColor: "#f7a90d",
              borderRadius: "50%",
              marginRight: "6px",
            }}
          />
          <Typography style={{ fontSize: "16px" }}> Visited</Typography>
        </div>
        <div style={{ display: "flex", alignItems: "center" }}>
          <div
            style={{
              width: "20px",
              height: "20px",
              backgroundColor: "#007bff",
              borderRadius: "50%",
              marginRight: "6px",
            }}
          />
          <Typography style={{ fontSize: "16px" }}>Attempted</Typography>
        </div>
      </Stack>
    </Paper>
  );
};

export default QueNumber;
